import React, {useState, useEffect} from 'react';
import Panel from './Panel';
import './PanelList.css';


const PanelList = ({ pokedex, selectedCard }) => {
    const [card, setCard] = useState(null)
    const [panelPick, setPanelPick] =useState(null)

    useEffect(() => {
        console.log(panelCompon[card]);
        setPanelPick(panelCompon[card]);
        selectedCard(panelPick);

    },[card]);

    const panelCompon = pokedex.map((pokemon, i) => {
        return <Panel onChange={num => setCard(num)} panelId={i} id={pokedex[i].id} name={pokedex[i].name} types={pokedex[i].types}/>
    })


    return (
        <div>
            <div>
                {panelCompon}
            </div>
        </div>
    );
}

export default PanelList;

